query:
/*+ NoMergeJoin(mk t) NoNestLoop(mk t ci) */ select count(*)
from movie_keyword AS mk
inner join title AS t
on t.id = mk.movie_id AND mk.keyword_id > 1509 AND t.kind_id < 7 AND t.production_year < 2006
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id < 2801908 AND ci.role_id < 2;
